import React from "react";
import { Link } from "react-router-dom";

const MainNavBar = () => {
    return (
        <nav>
            <span>
                <Link to="/">Home</Link>&nbsp;
                {/* <Link to="/profile">Contact</Link> */}
            </span>
        </nav>
    );
};

export default MainNavBar;
